import pandas as pd

if __name__ == "__main__":
    numeric_obj = ["Stick_Length", "Undercarriage_Pad_Width", "Tire_Size"]
    data =  pd.read_csv("../data/TrainAndValid.csv", parse_dates=["saledate"], low_memory=False)

    new_cat_pappng = {}

    for col, obj in zip(data.columns, data.dtypes):
        if obj == "object" and col not in numeric_obj:
            data[col] = data[col].fillna("None or Unspecified")  # remove Null values
            data[col] = data[col].apply(
                lambda s: s.strip())  # remove white space (e.g. data contains both 'B     ' and 'B')

            subkeys = list(data[col].unique())
            mean = {subkey : data[data[col] == subkey]['SalePrice'].mean() for subkey in subkeys}
            subkeys = sorted(subkeys, key=lambda x: mean[x])
            new_cat_pappng[col] = {key : i for i, key in enumerate(subkeys)}
    print(new_cat_pappng)


